import React, { Component } from 'react'

class Table extends Component {
    render() {
        const data = this.props.data;
        return (
            <div>
                <table id="Skills">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>GithubLink</th>
                            <th>Email</th>
                            <th>location</th>
                            <th>Public Repos</th>
                            <th>Bio</th>
                            </tr>
                    </thead>
                    <tbody>
                        {data.map(data => {
                            return (
                                <tr>
                                    <td>{data.name}</td>
                                    <td>{data.html_url}</td>
                                    <td>{data.Email}</td>
                                    <td>{data.location}</td>
                                    <td>{data.public_repos}</td>
                                    <td>{data.bio}</td>
                                </tr>
                            );
                        })}
                    </tbody>
                </table>

            </div>
        )
    }
}

export default Table
